,p_plug_name=>'About Page'
,p_region_template_options=>'#DEFAULT#:t-ContentBlock--padded:t-ContentBlock--h1:t-ContentBlock--lightBG'
,p_plug_template=>wwv_flow_imp.id(217654598368145377161)
,p_plug_display_sequence=>20
,p_location=>null
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<h1>This page is a guide on how to operate the Crime Management System</h1>',
'',
'This application allows the department to store, access, modify the data as per need aand offer a variety ',
'of features and pages to make that posssible.',
'<br>',
'<h2>Features</h2>',
'<ls>',
'    <ul>1. The about page is the Greeting page and lists all the features the system has</ul>',
'    <ul>2. The three lines next to the application name allow the user to acces the additional pages</ul>',
'    <ul>3. The master detail page allows the user to perform CRUD operations to the CRIME, EVENT and EVIDENCE TABLES. ',
'        However since the Evidence table is sensitive it can only be viewd not modified by the user</ul>',
'    <ul>4. Dashboard is placed for evaluation and analysis of data in a graphical form</ul>',
'    <ul>5. The calendar allows the user to see the reported dates of crime which have the status open</ul>',
'    <ul>6. certain forms have been created for ease of data entry </ul>',
'</ls>        ',
'<br>',
'<h2>Additional Details</h2>',
'<ls>',
'    <ul>1. The application has certain privileges that allows the Admin to perform certain operations, not accesible by all</ul>',
'    <ul>2. Any data manipulation is audited in a systematic way</ul>',
'    <ul>3. Access Control is managed very strictly</ul>',
'</ls>   ',
'',
'<h2><CENTER>WE REQUEST THE USER TO FOLLOW THE CODE OF CONDUCT WHILE USING THE APPLICATION</CENTER></h2>',
''))
,p_plug_query_num_rows=>15
,p_attributes=>wwv_flow_t_plugin_attributes(wwv_flow_t_varchar2(
  'expand_shortcuts', 'N',
  'output_as', 'HTML',
  'show_line_breaks', 'Y')).to_clob
);
end;
